// App.js or your main component file
import React from 'react';
import '../css/homePage.css'; // Make sure this path includes both CSS if they are separate or ensure the combined CSS is correctly referenced
import LeftPanel from '../Componets/SideBar';


function App() {
  return (
    <div className="layout-container">
    <aside className="left-panel">
      <LeftPanel />
    </aside>
    <main className="main-content">
      <div className="trending-container">
        <div className="trending-header">Trending</div>
        <div className="trending-content">
          <Article />
          <Article />
          <Article />
        </div>
      </div>
      <Section title="Topic One" />
      <Section title="Topic Two" />
      {/* Add more sections as needed */}
    </main>
    {/* <footer className="app-footer">
      Footer Content Here
    </footer> */}
  </div>

  );
}

function Section({ title }) {
  return (
    <div className="section-container">
      <h2 className="section-header">{title}</h2>
      <div className="articles-container">
        <Article />
        <Article />
        <Article />
      </div>
    </div>
  );
}

function Article() {
  return (
    <div className="article-card">
      <img src="path_to_image" alt="Article Thumbnail" className="article-image" />
      <div className="article-content">
        <h3>Lorem ipsum dolor sit amet.</h3>
        <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit...</p>
        <div className="read-time">2 mins read</div>
      </div>
    </div>
  );
}

export default App;
